import React, { Component } from 'react'
import submitFomHandler from "../Actions/Action"


export class Form extends Component {

  render() {
    return (
        <form onSubmit={submitFomHandler} className="user-form" >
        <input type="text" id="demo" ref="name" className="w-100 user-input" name = "name" placeholder="What needs to be done"></input>
    </form> 
    )
  }
}

export default Form;
